<!DOCTYPE html>
<html>
  <head>
    <title>JupyterLite Classic - Tree</title>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <link
      id="jupyter-lite-main"
      rel="preload"
      href="../build/bundle.js"
      main="index"
      as="script"
    />
    <script id="jupyter-lite-root" type="application/json">
      "../.."
    </script>
    <script id="jupyter-config-data" type="application/json">
      {
        "classicPage": "tree",
        "fullStaticUrl": "../build",
        "settingsUrl": "../build/schemas",
        "themesUrl": "../build/themes"
      }
    </script>
    <script>
      (async function() {
        await import('../../config-utils.js');
        const bundle = document.createElement('script');
        bundle.src = '../build/bundle.js';
        bundle.main = 'index';
        document.head.appendChild(bundle);
      })();
    </script>
  </head>
</html>
